import ExpenseItem from "./ExpenseItem";

function Expenses(props) {

  return (
    <div>
      <ExpenseItem expense={props.expense[0]} />
      <ExpenseItem expense={props.expense[1]} />
      <ExpenseItem expense={props.expense[2]} />
    </div>
  );
}

export default Expenses;
